import React, { Component } from "react";
import { Button } from "react-bootstrap";

class Arm extends Component {
  state = {};
  constructor() {
    super();
    this.init_connection();
  }

  render() {
    return <Button variant="primary">Arm</Button>;
  }
}

export default Arm;
